import React from 'react'
import Link from 'next/link'

// _includes/header.js
export default function Header(props) {
    return (
      <React.Fragment>
        <marquee>
      <header><p>This is the Header.</p></header>
      <div><Link href='/'><a>Home</a></Link></div>
      </marquee>
      </React.Fragment>
    )
  }
